import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="contact-info">
        <span className="phone">844-396-6839</span>
        <span className="email">support@gopaymentnow.com</span>
      </div>
    </header>
  );
};

export default Header;
